import {useState, useEffect} from 'react';
import SaveIcon from '@material-ui/icons/Save';
import CancelIcon from '@material-ui/icons/Cancel';
import Box from '@mui/material/Box';
import {TextField, Button} from '@material-ui/core';
import {post, put, get} from '../Calls';
import {experientaRoute} from '../ApiRoutes';
import { useNavigate, useParams } from 'react-router-dom';
import PropTypes from 'prop-types'

export default function ExperientaEdit(){

    const [experienta, setExperienta] = useState
    ({
        PunctPlecare: "",
        PunctSosire: "",
        Localitate: "",
        MijlocTransport: "",
        OraPlecare:"",
        DurataCalatorie:0,
        GradAglomerare:0,
        Observatii:"",
        NivelSatisfactie:0
    });

    const navigate = useNavigate();
    const routerParams = useParams();
    const id = routerParams.id;
    const errors = 0;

    useEffect(async () => {
        if (!id)
            return;

        let data = await get(experientaRoute, id);
        setExperienta(data);    
    }, [])

    const onChangeExperienta = e => {
        e.preventDefault();
        e.stopPropagation();
        setExperienta({...experienta, [e.target.name]: e.target.value});
    }
    

    const saveExperienta = async () => {
        if(!experienta.Localitate){
            alert("Bumsakalaka");
        }
        else{
            if (!id)
                await post(experientaRoute, experienta);
            else
                await put(experientaRoute, id, experienta);
            navigate("/ExperientaList");
        }
        
    }


    return(
        <div>
            <Box
                component="form"
                sx={{
                    '& .MuiTextField-root': { m: 1, width: '25ch' },
                }}
                noValidate
                autoComplete="off"
            >
                <div>
                    <div>
                        <TextField
                            required
                            autoFocus
                            id="Localitate"
                            name="Localitate"
                            label="Localitate"
                            fullWidth
                            value={experienta.Localitate}
                            onChange={e => onChangeExperienta(e)}
                        />
                        <TextField
                            required
                            autoFocus
                            id="PunctPlecare"
                            name="PunctPlecare"
                            label="Punct Plecare"
                            fullWidth
                            value={experienta.PunctPlecare}
                            onChange={e => onChangeExperienta(e)}
                        />
                        <TextField
                            required
                            autoFocus
                            id="PunctSosire"
                            name="PunctSosire"
                            label="Punct Sosire"
                            fullWidth
                            value={experienta.PunctSosire}
                            onChange={e => onChangeExperienta(e)}
                        />
                    </div>
                    <div>
                        <TextField
                            required
                            autoFocus
                            id="MijlocTransport"
                            name="MijlocTransport"
                            label="Mijloc Transport"
                            fullWidth
                            value={experienta.MijlocTransport}
                            onChange={e => onChangeExperienta(e)}
                        />
                        <TextField
                            required
                            autoFocus
                            id="OraPlecare"
                            name="OraPlecare"
                            label="Ora Plecare"
                            fullWidth
                            value={experienta.OraPlecare}
                            onChange={e => onChangeExperienta(e)}
                        />
                        <TextField
                            required
                            autoFocus
                            id="DurataCalatorie"
                            name="DurataCalatorie"
                            label="Durata Calatorie"
                            fullWidth
                            value={experienta.DurataCalatorie}
                            onChange={e => onChangeExperienta(e)}
                        />
                    </div>
                    <div>
                        <TextField
                            required
                            autoFocus
                            id="GradAglomerare"
                            name="GradAglomerare"
                            label="Grad Aglomerare"
                            fullWidth
                            value={experienta.GradAglomerare}
                            onChange={e => onChangeExperienta(e)}
                        />
                        <TextField
                            required
                            autoFocus
                            id="NivelSatisfactie"
                            name="NivelSatisfactie"
                            label="Nivel satisfactie"
                            fullWidth
                            value={experienta.NivelSatisfactie}
                            onChange={e => onChangeExperienta(e)}
                        />
                        <TextField
                            autoFocus
                            id="Observatii"
                            name="Observatii"
                            label="Observatii"
                            fullWidth
                            value={experienta.Observatii}
                            onChange={e => onChangeExperienta(e)}
                        />
                    </div>
                </div>
            </Box>
            <Button id='btnCancel' color="primary" variant='outlined' startIcon={<CancelIcon />}
                onClick={() => {navigate("/ExperientaList")}}
            >
                Cancel
            </Button>  

            <Button id='btnSave' color="primary" variant='outlined' startIcon={<SaveIcon />}
                onClick={saveExperienta}
            >
                Save
            </Button> 
        </div>
    )
}
